import logo from './logo.svg';
import './App.css';
import './bootstrap-5.2.3-dist/css/bootstrap-grid.min.css';
import './bootstrap-5.2.3-dist/js/bootstrap.bundle.min.js';
import Dau from './DoAn/Dau';
import Banner from './DoAn/Banner';

const Member=[
    {
      Avatar: "download.png",
      HoTen: "TT Tuan",
      loai: "VIP",
      TGia: '07/9/2023'

    },
    {
      Avatar: "download.png",
      HoTen: "Chinh",
      loai: "VVIP",
      TGia: '04/9/2023'
    }
  ]

function App() {
  const listMember= Member.map(function(item){
    return (
      <TheTV member={item}/>
  );
  });
  return (

    <>
    <div class="row">
      <div class="col-md-6">
    <Dau/>
    <Banner/>

    </div>
    <div class="col-md-6">
    {listMember}
    </div>
    </div>
    </>
  );
}

export default App;
